package leetcode.others;

import java.util.ArrayList;
import java.util.Arrays;
import java.util.LinkedList;
import java.util.List;

class FindAllAnagramsInAString {
    public static void main(String[] args) {
        FindAllAnagramsInAString obj = new FindAllAnagramsInAString();
        String s = "cbaebabacd";
        String p = "abc";
        //        String s = "abab";
        //        String p = "ab";

        //String s = "";
        //String p = "";

        System.out.println(obj.findAnagrams(s, p));
    }


    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> result = new ArrayList<>();

        int inputLength = s.length();
        int patternLength = p.length();

        if (inputLength < patternLength) {
            return result;
        }

        int[] inputCount = new int[26];
        int[] patternCount = new int[26];

        for (int i = 0; i < patternLength; i++) {
            patternCount[(int) p.charAt(i) - 'a']++;
        }

        int windowSize = 0;
        for (int i = 0; i < inputLength; i++) {
            inputCount[(int) s.charAt(i) - 'a']++;

            if (i >= patternLength) {
                inputCount[(int) s.charAt(i - patternLength) - 'a']--;
            }


            if (Arrays.equals(patternCount, inputCount)) {
                result.add(i - patternLength + 1);
            }
        }

        return result;
    }

    public List<Integer> findAnagrams1(String s, String p) {
        List<Integer> result = new LinkedList<>();

        int patternLength = p.length();
        int inputLength = s.length();

        int[] patternCount = new int[26];
        for (int i = 0; i < patternLength; i++) {
            patternCount[(int) p.charAt(i) - 'a']++;
        }

        for (int i = 0; i < inputLength; i++) {
            StringBuilder sb = new StringBuilder();
            for (int j = 0; j < patternLength; j++) {
                if ((i + j) < inputLength) {
                    char ch = s.charAt(i + j);
                    sb.append(ch);
                }
            }
            if (sb.toString().length() == patternLength) {
                boolean isValid = isAnagram(sb.toString(), patternCount);
                if (isValid) {
                    result.add(i);
                }
            }
        }

        return result;
    }

    public boolean isAnagram(String input, int[] patternCount) {
        int[] inputCount = new int[26];
        int length = input.length();

        for (int i = 0; i < length; i++) {
            inputCount[(int) input.charAt(i) - 'a']++;
        }

        if (Arrays.equals(inputCount, patternCount)) {
            return true;
        }

        return false;
    }
}
